누나와 나의 유전자 관계다.

누나는 열정은 없는데 욕심이 많다.

나는 열정은 있는데 욕심이 없다.

마치 정확히 반으로 쪼개지지 않은 느낌으로 서로가 어떤것을 조금 더 가지거나 덜 가졌다.

그래서 누나는 나를 통해서 욕심을 계속 주입한다.

결과적으로 누나가 존재하는 한 나는 욕심의 고통속에서 

끌려다닌다는 이야기다.

내가 어떻게 선택 해야할까 라는 생각을 했다.

물론 누나가 어떤 공감능력 없이 하는 말들이

나를 푸시할 때가 있다.

내가 워낙 욕심이 없을 때가 많기 때문이다.

그런데 너무 자주보게되면 

트러블이 날 수 밖에 없다.

누나는 말을 하는 것에 책임감을 느끼지 않지만

반대로 나는 듣는 것에 책임감을 느끼기 때문에

누나의 말을 믿도 끝도 없이 수용하는건 

내 자신을 사랑하지 못하게 될 가능성이 높아지고 

그로인해 세상이 나를 사랑하지 못하는 상황이 되버리고,

다시 내가 무너져내릴 가능성이 높아지기 때문이다.

누나 외의 외부세계의 모든 사람들과의 관계도 마찬가지다.

푸시를 하는 사람이 있는건 좋은거다.

그러나 내가 '어떤 시기에 어디까지 수용 할 것이냐'에 따라

그것이 '약'이 될 수 있고 '독'이 될수 있다는 이야기다.

누군가 이런 말을 했다.

사람을 도구로 생각해야한다고 

인간은 모두 이기적이라고.

그렇다면 어차피 인간은 자신의 생존을 위해서 자신의 인생을 사는

이기적 존재라면 가장 최선의 이기적 방식을 찾아야 한다고. 

나는 그걸 잘 못한다고 생각했다.

근데 그것도 생각해보면 이기적인 마음에서 나타난 것이라는 걸 알게된다.

내 이기적 행동은 사랑받기 위해,

누군가를 사랑하는 행위에 특화되어 있어서 그럴지 모른다. 

이렇듯 최근에 드는 생각은

내가 사랑, 애정에 끌려 다닌 다는 것이다.

사랑에 끌려 다닌 다는 것은 사랑을 줄 만한 상황이 아니라

사랑이 결핍되어 누군가의 사랑이 필요한 상태라는 것이다. 

이건 나에 대한 날카로운 셀프 피드백이라고 생각한다.

받아들이자. 나는 애정결핍이 맞다.

그걸 받아들이고 해결책을 생각해보자.

내 페이스를 잃게 되는 가장 큰 원인이 여기에 있다.

사랑에 대한 욕구. 사랑을 주고 받는것에 대한 결핍.

이걸 채우기 위해선 어떻게 해야할까?

이성적, 감성적 방법을 찾아보자.

이성적 해결책

계산없는 표현이나 경쟁없이 외부에서 사랑을 주고 받을 만한 곳을 찾아야 된다.

ex) 취미활동 동아리, 종교활동 , 연애 , 봉사활동 등등

그리고 내가 던지는 것에 60~70퍼센트 정도만이라도 돌아오는 사람을 만나야 한다.

내가 넓은 공터만큼 공허한 사람한테 물 한바가지씩 뿌린다고 해도 

결국 마르는 속도가 더 빠를것이다.

욕심이 작고 감사 할 줄 아는 사람을 만나야 한다.

감성적 해결책 

애초에 감성적해결책을 글로 쓴다는 것 자체가 좀 그렇지만 

그때 그때의 감정에 솔직해지는 것. 

싫을 땐 싫다. 좋을 땐 좋다.

인간으로서의 나 자신을 위해서 그렇게 행동하는것이다.

그리고 

가장 큰 건 이거다.

자기 자신을 사랑하는 방법을 찾는 것

그렇게 해야만 일단 이것이 계속 새어나가는 것을 막을 수 있다.

예를들어서 나를 위한 행동을 했는데

이기적이라는 비판을 하는 사람이 있다면 끊어 내는 것이다.

왜냐, 인간은 모두 이기적인 성질을 가지고 있어서

이기적이라는 비판을 한다는 것 자체가 

상대방을 노골적으로 착취하겠다는

이기적 선택 중에서도 최악의 선전포고이기 때문이다. 

나 자신을 사랑하는 방법은

나는 이것이라고 생각한다.

내가 할 수 있을만큼만 하는 것

내가 그날 그때 상태에서 감당 가능한 것을 하는 것 

결국 나 자신을 사랑하는 방법은 내 제한선 이상의 노력이나 푸시를 하지 않는 것이다.

그렇게 되면 역설적으로 자기애가 살아나게 되고

